import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      friend1: {
        name: "Elvira",
      },
      friend2: {
        name: "Lenara",
      },
      friend3: {
        name: "Vika",
      },
    };
  }

  render() {
    return <div className="App"></div>;
  }
}

export default App;
